import Register from './views/pages/Register';
import verifyEmail from './views/pages/verifyEmail';


const PublicRoutes = [
	{
		path: '/register',
		component: Register
	},
	{
		path: '/verify-email',
		component: verifyEmail
	}
];

export default PublicRoutes;
